    <mat-form-field class="full-width">
        <input matInput type="text" placeholder="Pavadinimas" name="name" [(ngModel)]="this.screen.name">
    </mat-form-field>

    <div class="flex">
        <mat-form-field class="block">
            <input matInput type="color" placeholder="Pagrindin spalva" name="primaryColor" [(ngModel)]="this.screen.settings.primaryColor">
        </mat-form-field>

        <mat-form-field class="block">
            <input matInput type="color" placeholder="Akcentin spalva" name="accentColor" [(ngModel)]="this.screen.settings.accentColor">
        </mat-form-field>
    </div>
    <div class="flex">
        <mat-form-field class="block">
            <input matInput type="color" placeholder="1 teksto spalva" name="text1" [(ngModel)]="this.screen.settings.text1">
        </mat-form-field>

        <mat-form-field class="block">
            <input matInput type="color" placeholder="1 fono spalva" name="bg1" [(ngModel)]="this.screen.settings.bg1">
        </mat-form-field>
    </div>
    <div class="flex">
        <mat-form-field class="block">
            <input matInput type="color" placeholder="2 teksto spalva" name="text2" [(ngModel)]="this.screen.settings.text2">
        </mat-form-field>

        <mat-form-field class="block">
            <input matInput type="color" placeholder="2 fono spalva" name="bg2" [(ngModel)]="this.screen.settings.bg2">
        </mat-form-field>

    </div>

    <mat-form-field class="block-double">
        <mat-label>Vykstani pamok kortels pasikeiia kas</mat-label>
        <input matInput type="number" name="timetableDuration" [(ngModel)]="this.screen.settings.timetableDuration" min="0.6" max="4" step="0.1" value="1">
        <mat-hint>sek.</mat-hint>
    </mat-form-field>

    <mat-form-field class="block-double">
        <mat-label>Skambuio grojimo trukm</mat-label>
        <input matInput type="number" name="bellDuration" [(ngModel)]="this.screen.settings.bellDuration" min="15" max="300" step="0.1" value="60">
        <mat-hint>sek.</mat-hint>
    </mat-form-field>

    <mat-form-field class="block-double">
        <mat-label>Turinio kortels / nuotraukos pasikeiia kas</mat-label>
        <input matInput type="number" name="SlideDuration" [(ngModel)]="this.screen.settings.SlideDuration" min="15" max="300" step="0.1" value="60">
        <mat-hint>sek.</mat-hint>
    </mat-form-field>

    <div class="flex">
        <div style="margin-right: 40px;">Lietuvos valstybs vliava<br>rodoma atmintinomis dienomis</div>
        <mat-slide-toggle (change)="this.screen.settings.LT = !this.screen.settings.LT;" [checked]="this.screen.settings.LT">{{ this.screen.settings.LT ? 'Taip': 'Ne' }}</mat-slide-toggle>
    </div>
    <!-- <div class="toggle-grid">
        <label><i class="fas fa-redo-alt"></i> Rodomi Horoskopai</label>
        <mat-slide-toggle (change)="this.formData.repeatTimes = !this.formData.repeatTimes;" [checked]="this.formData.repeatTimes">{{ this.formData.repeatTimes ? 'Kartoti': 'Nra' }}</mat-slide-toggle>
    </div> -->

    <!-- <div class="toggle-grid">
        <label><i class="fas fa-redo-alt"></i> Pasikartojimas</label>
        <mat-slide-toggle (change)="this.formData.repeatTimes = !this.formData.repeatTimes;" [checked]="this.formData.repeatTimes">{{ this.formData.repeatTimes ? 'Kartoti': 'Nra' }}</mat-slide-toggle>
    </div> -->

    <!-- <div class="toggle-grid">
        <label><i class="fas fa-redo-alt"></i> Pasikartojimas</label>
        <mat-slide-toggle (change)="this.formData.repeatTimes = !this.formData.repeatTimes;" [checked]="this.formData.repeatTimes">{{ this.formData.repeatTimes ? 'Kartoti': 'Nra' }}</mat-slide-toggle>
    </div> -->

    <mat-dialog-actions>
        <button type="submit" class="btn">{{ (this.config.edit) ? 'Isaugoti' : 'Pridti' }}</button>
        <button type="button" class="btn" mat-dialog-close>Ataukti</button>
    </mat-dialog-actions>
</form>
